import React from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";
import styles from "./styles.module.css";

const BarGraph = ({ data }) => {
  return (
    <BarChart
      data={data}
      margin={{
        top: 5,
        right: 30,
        left: 15,
        bottom: 5,
      }}
      barSize={20}
      bsPrefix={styles.graphContainer}
    >
      <XAxis dataKey="name" scale="point" padding={{ left: 20, right: 20 }} />
      <YAxis />
      <Tooltip />

      <Bar dataKey="Statistics" fill="#43bfe5" />
    </BarChart>
  );
};

export default BarGraph;
